const HomeMyStocksContainer = () => {

  const Container = styled.div`    
    background-color: white;
    margin-bottom : 2rem;
    border-radius: 20px;
  `;

  return (
    <Container>
      <HomeMyStockHeader></HomeMyStockHeader>

    </Container>
  )
}

export default HomeMyStocksContainer
